%D1%8F%D1%82%D0%BE%D1%81%D0%BB%D0%B0%D0%B2_%D0%98%D0%B3%D0%BE%D1%80%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0432\u044f\u0442\u043e\u0441\u043b\u0430\u0432 \u0418\u0433\u043e\u0440\u0435\u0432\u0438\u0447\">\u0421\u0432\u044f\u0442\u043e\u0441\u043b\u0430\u0432<\/a> \u0438 \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B0%D0%BD%D0%BD_I_%D0%A6%D0%B8%D0%BC%D0%B8%D1%81%D1%85%D0%B8%D0%B9\" title=\"\u0418\u043e\u0430\u043d\u043d I \u0426\u0438\u043c\u0438\u0441\u0445\u0438\u0439\">\u0418\u043e\u0430\u043d\u043d \u0426\u0438\u043c\u0438\u0441\u0445\u0438\u0439<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u043f\u043e\u0447\u0451\u0442\u043d\u044b\u0439 \u043c\u0438\u0440 \u043d\u0430 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0432\u043e\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u043c\u043e\u0449\u0438, \u0441\u043e\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u044f \u043f\u0440\u0435\u0436\u043d\u0438\u0445 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u0432 \u0438 \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0431\u043e\u043b\u0433\u0430\u0440\u0441\u043a\u0438\u0445 \u0437\u0435\u043c\u0435\u043b\u044c \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D1%8F\" title=\"\u0412\u0438\u0437\u0430\u043d\u0442\u0438\u044f\">\u0412\u0438\u0437\u0430\u043d\u0442\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1374\" class=\"mw-redirect\" title=\"1374\">1374<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2_(%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u041a\u0438\u0440\u043e\u0432 (\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u