e\u0440\u0435\u0446\u043a\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1534\" class=\"mw-redirect\" title=\"1534\">1534<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%82%D1%8C%D0%B5,_%D0%96%D0%B0%D0%BA\" title=\"\u041a\u0430\u0440\u0442\u044c\u0435, \u0416\u0430\u043a\">\u0416\u0430\u043a\u0430 \u041a\u0430\u0440\u0442\u044c\u0435<\/a> \u0434\u043e\u0441\u0442\u0438\u0433\u043b\u0430 \u0443\u0441\u0442\u044c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BA%D0%B0_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9B%D0%B0%D0%B2%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D1%8F\" title=\"\u0420\u0435\u043a\u0430 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u044f\">\u0440\u0435\u043a\u0438 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u044f<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1619\" class=\"mw-redirect\" title=\"1619\">1619<\/a>&#160;\u2014 \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B0%D1%80%D0%B5%D1%82_(%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u0424\u0438\u043b\u0430\u0440\u0435\u0442 (\u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439)\">\u0424\u0438\u043b\u0430\u0440\u0435\u0442<\/a>, \u043e\u0442\u0435\u0446 \u0446\u0430\u0440\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0438\u0445\u0430\u0438\u043b \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\u0430<\/a>, \u0432\u043e\u0437\u0432\u0435\u0434\u0451\u043d \u0432 \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0438 \u0412\u0441\u0435\u044f \u0420\u0443\u0441\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1701\" class=\"mw-redirect\" title=\"1701\">1701<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D1%80%D0%BE%D0%B9%D1%82\" title=\"\u0414\u0435\u0442\u0440\u043e\u0439\u0442\">\u0414\u0435\u0442\u0440\u043e\u0439\u0442<\/a>. \u041e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u043c \u0433\u043e\u0440\u043e\u0434\u0430 (\u0442\u043e\u0433\u0434\u0430 \u044d\u0442\u043e \u0431\u044b\u043b \u043f\u043e\u0441\u0451\u043b\u043e\u043a \u0434\u043b\u044f \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438 \u043c\u0435\u0445\u0430\u043c\u0438) \u0441\u0442\u0430\u043b \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c\u0438 \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f\u043c\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B4%D0%B8%D0%BB%D0%BB%D0%B0%D0%BA,_%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a, \u0410\u043d\u0442\u0443\u0430\u043d\">\u0410\u043d\u0442\u0443\u0430\u043d \u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a<\/a>, \u0438\u043c\u044f