\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u043f\u043e\u0432\u0435\u043b\u0435\u043b\u0430 \u043e\u0442\u0434\u0430\u0442\u044c \u043f\u043e\u0434 \u0441\u0443\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D0%B8%D1%89%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0430\u0434\u0438\u0449\u0435\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0410. \u0420\u0430\u0434\u0438\u0449\u0435\u0432\u0430<\/a>, \u0430\u0432\u0442\u043e\u0440\u0430 \u0440\u043e\u043c\u0430\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%82%D0%B5%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%B8%D0%B5_%D0%B8%D0%B7_%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0_%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%83\" title=\"\u041f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0438\u0437 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443\">\u041f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0438\u0437 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443<\/a>\u00bb.<\/li><li>\u0412\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e \u0437\u0430\u0444\u0438\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043d\u043e \u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u0417\u0435\u043c\u043b\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Barbotan_(%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82)\" title=\"Barbotan (\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442)\">\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u0430<\/a> .<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1791\" class=\"mw-redirect\" title=\"1791\">1791<\/a>&#160;\u2014 \u0447\u043b\u0435\u043d\u044b \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043a\u0440\u044b\u043b\u0430 \u044f\u043a\u043e\u0431\u0438\u043d\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u043b\u0438\u0448\u0435\u043d\u044b \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u0442\u0432\u0430 \u0441\u0432\u043e\u0438\u043c\u0438 \u043e\u0434\u043d\u043e\u043f\u0430\u0440\u0442\u0438\u0439\u0446\u0430\u043c\u0438.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837\" class=\"mw-redirect\" title=\"1837\">1837<\/a>&#160;\u2014 \u0442\u0440\u0430\u0433\u0438\u0447\u0435\u0441\u043a\u0438 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u0430\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f \u043f\u0430\u0440\u0430\u0448\u044e\u0442\u0430 \u043d\u043e\u0432\u043e\u0439 \u0444\u043e\u0440\u043c\u044b \u0441 \u043f\u0435\u0440\u0435\u0432\u0435\u0440\u043d\u0443\u0442\u044b\u043c \u0432\u0432\u0435\u0440\u0445 \u0434\u043d\u043e\u043c \u043a\u0443\u043f\u043e\u043b\u043e\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439, \u043f\u043e \u0437\u0430\u043c\u044b\u0441\u043b\u0443 \u0435\u0433\u043e \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044f \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d\u0430 \u0420\u043e\u0431\u0435\u0440\u0442\u0430 \u041a\u043e\u043a\u0438\u043d\u0433\u0430 (<a href=\"https:\/\/en.wikipedia.org\/wiki\/Robert_Cocking\" class=\"extiw\" title=\"en:Robert Cocking\">en:Robert Cocking<\/a>), \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u043b \u043f\u0440\u0435\u0434\u043e\u0442\u0432\u0440\u0430\u0442\u0438\u0442\u044c \u0440\u0430\u0441\u043a\u0430\u0447\u0438\u0432\u0430\u043d\u0438\u0435. \u041f\u043e\u0434\u043d\u044f\u0442\u044b\u0439 \u043d\u0430 \u0432\u044b\u0441\u043e\u0442\u0443 2000 \u043c\u0435\u0442\u0440\u043e\u0432 \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u043e\u043c \u00ab\u0413\u0440\u0435\u0439\u0442 \u041d\u0430\u0441\u0441\u043e \u0411\u0430\u043b\u0443\u043d\u00bb, \u043f\u0430\u0440\u0430\u0448\u044e\u0442 \u0441 \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0441\u044f \u043f\u043e\u0434 \u043d\u0438\u043c \u0432 \u043a\u043e\u0440\u0437\u0438\u043d\u0435 \u041a\u043e\u043a\u0438\u043d\u0433\u043e\u043c \u043d\u0430\u0447\u0430\u043b \u0441\u043f\u0443\u0441\u043a\u0430\u0442\u044c\u0441\u044f \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u0443\u0434\u0430\u0447\u043d\u043e, \u043d\u043e \u0437\u0430\u0442\u0435\u043c \u0432\u0435\u0440\u0445\u043d\u0438\u0439 \u043e\u0431\u043e\u0434 \u043a\u0443\u043f\u043e\u043b\u0430 \u0441\u043c\u044f\u043b\u0441\u044f \u0438 \u0441\u043f\u0443\u0441\u043a \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043b\u0441\u044f \u0432 \u043f\u0430\u0434\u0435\u043d\u0438\u0435, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0435\u0435\u0441\u044f \u0441\u043c\u0435\u0440\u0442\u044c\u044e \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044f. \u0410 \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u043e\u0432\u0430\u043b \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442 \u0427\u0430\u0440\u043b\u044c\u0437 \u0413\u0440\u0438\u043d (Charles Green), \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0435\u043c \u0441\u0442\u0430\u043d\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u043c \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u0435\u043c, \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u043c 100 \u043f\u043e\u043b\u0451\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1847\" class=\"mw-redirect\" title=\"1847\">1847<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0435 \u043a\u043e\u043b\u043e\u043d\u0438\u0441\u0442\u044b-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%BC%D0%BE%D0%BD%D1%8B\" title=\"\u041c\u043e\u0440\u043c\u043e\u043d\u044b\">\u043c\u043e\u0440\u043c\u043e\u043d\u044b<\/a> \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043b\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B5_%D0%A1%D0%BE%D0%BB%D1%91%D0%BD%D0%BE%D0%B5_%D0%BE%D0%B7%D0%B5%D1%80%D0%BE\" title=\"\u0411\u043e\u043b\u044c\u0448\u043e\u0435 \u0421\u043e\u043b\u0451\u043d\u043e\u0435 \u043e\u0437\u0435\u0440\u043e\">\u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0421\u043e\u043b\u0451\u043d\u043e\u0433\u043e \u043e\u0437\u0435\u0440\u0430<\/a>, \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0441\u0442\u0430\u0432\u0448\u0435\u0435 \u0433\u043e\u0440\u043e\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D1%82-%D0%9B%D0%B5%D0%B9%D0%BA-%D0%A1%D0%B8%D1%82%D0%B8\" title=\"\u0421\u043e\u043b\u0442-\u041b\u0435\u0439\u043a-\u0421\u0438\u0442\u0438\">\u0421\u043e\u043b\u0442-\u041b\u0435\u0439\u043a-\u0421\u0438\u0442\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851\" class=\"mw-redirect\" title=\"1851\">1851<\/a>&#160;\u2014 \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u043e\u0442\u043c\u0435\u043d\u0451\u043d \u043d\u0430\u043b\u043e\u0433 \u043d\u0430 \u043e\u043a\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864\" class=\"mw-redirect\" title=\"1864\">1864<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%9A%D0%B5%D1%80%D0%BD%D1%81%D1%82%D0%B0%D1%83%D0%BD%D0%B5\" title=\"\u0412\u0442\u043e\u0440\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041a\u0435\u0440\u043d\u0441\u0442\u0430\u0443\u043d\u0435\">\u0432\u0442\u043e\u0440\u043e\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u043f\u0440\u0438 \u041a\u0435\u0440\u043d\u0441\u0442\u0430\u0443\u043d\u0435<\/a> \u0433\u0435\u043d\u0435\u0440\u0430\u043b \u041a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%80%D0%BB%D0%B8,_%D0%94%D0%B6%D1%83%D0%B1%D0%B0%D0%BB_%D0%90%D0%BD%D0%B4%D0%B5%D1%80%D1%81%D0%BE%D0%BD\" title=\"\u042d\u0440\u043b\u0438, \u0414\u0436\u0443\u0431\u0430\u043b \u0410\u043d\u0434\u0435\u0440\u0441\u043e\u043d\">\u0414\u0436\u0443\u0431\u0430\u043b \u042d\u0440\u043b\u0438<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u0443\u044e \u0430\u0440\u043c\u0438\u044e \u0414\u0436\u043e\u0440\u0434\u0436\u0430 \u041a\u0440\u0443\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870\" class=\"mw-redirect\" title=\"1870\">1870<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a> \u043f\u0440\u0438\u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0442\u0440\u0430\u043d\u0441\u043a