043e\u0434\u0430&#160;\u2014 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u043e\u0439&#160;\u2014 \u043e\u0442 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0441\u0442\u0430 \u0434\u043e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u0438\u0445 \u0432\u043e\u0440\u043e\u0442. \u0423\u043b\u0438\u0446\u0430 \u043f\u043e\u0442\u043e\u043c \u043c\u0435\u043d\u044f\u043b\u0430 \u0441\u0432\u043e\u0451 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u0411\u0440\u0438\u0432\u0438\u0431\u0430\u0441 (\u0421\u0432\u043e\u0431\u043e\u0434\u044b), \u0413\u0438\u0442\u043b\u0435\u0440-\u0448\u0442\u0440\u0430\u0441\u0441\u0435, \u041b\u0435\u043d\u0438\u043d\u0430, \u0432\u043d\u043e\u0432\u044c \u0411\u0440\u0438\u0432\u0438\u0431\u0430\u0441, \u0430 \u0442\u0440\u0430\u043c\u0432\u0430\u0439 \u0441\u0432\u043e\u0451 \u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u043f\u043e \u043d\u0435\u0439 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906\" class=\"mw-redirect\" title=\"1906\">1906<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0420\u043e\u0441\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D1%8B%D0%BF%D0%B8%D0%BD,_%D0%9F%D1%91%D1%82%D1%80_%D0%90%D1%80%D0%BA%D0%B0%D0%B4%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u043e\u043b\u044b\u043f\u0438\u043d, \u041f\u0451\u0442\u0440 \u0410\u0440\u043a\u0430\u0434\u044c\u0435\u0432\u0438\u0447\">\u041f. \u0421\u0442\u043e\u043b\u044b\u043f\u0438\u043d<\/a> \u043f\u0440\u0438\u0437\u0432\u0430\u043b \u043a \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \u00ab\u0432\u0440\u0430\u0433\u0430\u043c\u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/19